import React, { useState } from 'react'
import { Container } from 'react-bootstrap'
import TextEditor from '../../components/ReportForm/TextEditor'
import './styles.scss'
import ButtonCustom from '../../components/ButtonCustom'
import HTMLParser from '../../components/HTMLParser'

export default function MyWordSreen() {
    const [content, setContent] = useState({
        isShow: false,
        value: '<p>Vi Đăng</p><p><strong>Quang Rất </strong> Chào <em> Anh Nam lần 2</em></p><p><em>﻿</em><img src="data:image/jpeg;base64,"></p>',
    })

    const handleEditorChange = (value) => {
        setContent({ ...content, value: value })
    }

    const handleSaveReport = () => {
        console.log('Lưu lại', content.value)
        setContent({ ...content, isShow: false })
    }
    const handleEditReport = () => {
        console.log('Chuẩn bị EDit', content.value)
        setContent({ ...content, isShow: true })
    }
    return (
        <div id="textedit">
            <h1>Quang Vi Đăng's Post</h1>
            {content.isShow ? (
                <div id="textedit_1">
                    <Container>
                        <TextEditor
                            value={content.value}
                            onChange={handleEditorChange}
                        />
                    </Container>
                    <ButtonCustom
                        handleClickButton={handleSaveReport}
                        text={'SAVE'}
                    />
                </div>
            ) : (
                <div id="textedit_2">
                    <div className="editScreen">
                        <HTMLParser htmlString={content.value} />
                        <ButtonCustom
                            handleClickButton={handleEditReport}
                            img_show={'inline'}
                            src_img_button={
                                'https://img.icons8.com/?size=1x&id=3dbDiCK5fTtx&format=png'
                            }
                        />
                    </div>
                </div>
            )}
        </div>
    )
}
